import React from "react";

function Header() {
  return (
    <div className="header">
      <h2>David A. Vasquez</h2>
      <div className="header-button-container">
        <button
          onClick={() =>
            document
              .getElementById("about-me")
              .scrollIntoView({ behavior: "smooth" })
          }
        >
          About Me
        </button>

      </div>
    </div>
  );
}

export default Header;
